Return highest number in grouped data<p>I have grouped some data by some conditions and get the expected result. However, I would like to only return the item with the <strong>highest number</strong> in each <code>pool</code>. If I only would like to have the highest one I could add <code>.sort({ correctBets: -1 }).limit(1)</code> to the end,  but now I need one in each pool. And if two or more correctBets is the same in one pool I would like to return all those items. How would I do this?</p>

<pre><code>const coupon = await CouponModel.aggregate([
    {
      $match: {
        eventId: { $in: eventIds },
      },
    },
    {
      $group: {
        _id: {
          userId: '$userId',
          pool: '$pool',
        },
        correctBets: {
          $sum: '$correctBets',
        },
      },
    },
  ])
</code></pre>

