  { _id: { userId: '5dfb2db245011a390fec4f7d', pool: 'bar' },
    correctBets: 6 },
  { _id: { userId: '5df344a1372f345308dac12a', pool: 'bar' },
    correctBets: 5 },
  { _id: { userId: '5dfb2db245011a390fec4f7d', pool: 'foo' },
    correctBets: 11 } 
]
</code></pre>

<p>My expected result should look like this</p>

<pre><code>[
  { _id: { userId: '5dfb2db245011a390fec4f7d', pool: 'foo' },
    correctBets: 11 },
  { _id: { userId: '5dfb2db245011a390fec4f7d', pool: 'bar' },
    correctBets: 6 }
]
</code></pre>

<p>Edit: the proposed duplicate question dont handle max values for each 'key' as in my case is two pools. Foo and bar.</p>

