MongoDB truncating LocalDateTime nanosecs when MongoTemplate persists the data<p>I have a Spring Boot 2 project using MongoDB as database.</p>

<p>When I Instantiate an object containing a date as LocalDateTime by calling LocalDateTime.now(); I receive a datetime containing nanoseconds with more than 4 numerical places. </p>

<p>When I persist this data in mongoDB using mongotemplate.save, the value is saved containing 3 places for nanoseconds only (the rest is filled with zero). So, how can I accomplish the same precision when storing to DB? Or another option: how would I limit the precision when creating a LocalDateTime instance in java?</p>

<pre class="lang-java prettyprint-override"><code>@Document("Entity")
public class Entity implements Serializable {

    @Id
    private String id;

    @Indexed(name = "created")
    private LocalDateTime created;

    public HistoryEntity(){
        // This gives me 2020-01-30T13:25:09.817182
        this.created = LocalDateTime.now();
    }
}
</code></pre>

<p>

<pre><code>@Repository
public class DAO {

    @Autowired
    private MongoTemplate mongoTemplate;


    public void save(Entity e) {
        // When value is persisted, I get 2020-01-30T13:25:09.817 if I look into mongoDB instance or if I retrieve the same entity from DB in Java
        Entity saved = mongoTemplate.save(e);
    }
}
</code></pre>

