Add function data to my model - Node/Express<p>I have a form with the input fields "firstName", "lastName" and "assetTag". I want to submit that form and post all that data plus one additional field called "modelType". The data from the modelType field is from the function call <strong>si.system()</strong> but i'm not sure how to pass that into the Model because it's a promise.</p>

<p>How can I pass the data from my console.log(data.model) into my formData?</p>

<p>app.js post request:</p>

<pre><code>app.post('/', (req, res) =&gt; {

        si.system()
    .then(data =&gt; console.log(data.model))
    .catch(error =&gt; console.error(error))

  const formData = {
    firstName: req.body.firstName,
    lastName: req.body.lastName,
    assetTag: parseInt(req.body.assetTag)
  }

  const system = new System(formData);

  system.save()
    .then(result =&gt; {
      console.log(result);
    })
    .catch(err =&gt; {
      console.log(err);
    });

});
</code></pre>

<p>Model: </p>

<pre><code>const mongoose = require('mongoose');

var SystemSchema = new mongoose.Schema({
    firstName: {
        type: String,
        required: true
    },
    lastName: {
        type: String,
        required: true
    },
    assetTag: {
        type: Number,
        required: true
    },
    modelType: {
        type: String,
        required: true
    }
});

module.exports = mongoose.model('System', SystemSchema);
</code></pre>

