            "labels": [
                "test",
                "testcat2"
            ]
        },
        {
            "pID": 3333,
            "name": "Test Item #3333",
            "amount": 33,
            "labels": [
                "test",
                "testcat3"
            ]
        }
    ]
}
</code></pre>

<p>My objective is to fetch <strong>all</strong> the products matching a set of labels. For example, the idea is that I can search for <code>["test"]</code> and get all 3 items, but <code>["test", "testcat1"]</code> should only return the first one.</p>

<p>Searching on the internet I see people have suggested using <code>db.inventories.find( { "_id" : 72986, "items.labels" : { $all : ["test", "testcat2"] } } )</code>, but I get back the whole array, not just the matching item:</p>

<pre class="lang-js prettyprint-override"><code>[
    {
        "pID": 1111,
        "name": "Test Item #1111",
        "amount": 11,
        "labels": [
            "test",
