    {
        "pID": 3333,
        "name": "Test Item #3333",
        "amount": 33,
        "labels": [
            "tets",
            "testcat3"
        ]
    }
]
</code></pre>

<p>When I try the projection <code>{"items.$" : 1}</code> I'm getting the correct item, but just one. I need a similar behavior that can fetch multiple items.</p>

<p>Thanks in advance!</p>

